import "./Form.css";
function Form() {
  return (
    <form className="feed-form" action="">
      <div className="feed-form__text">Записаться онлайн</div>
      <p className="feed-form__name">Имя ребенка</p>
      <input type="text" placeholder="Имя" name="name" />
      <p className="feed-form__phone">Телефон</p>
      <input type="text" placeholder="Телефон" name="phone" />
      <select className="feed-form" name="" id="">
        <option value="">Стрижка для мальчика</option>
        <option value="">Стрижка для девочки</option>
        <option value="">Бритье под ноль</option>
        <option value="">Стрижка челки для девочки</option>
        <option value="">Прокалывание мочек ушей Inverness</option>
        <option value="">Брейды с канекалоном/без канекалона</option>
        <option value="">3Д косы с канекалоном</option>
      </select>
    </form>
  );
}

export default Form;
